import React from 'react';
import { useNavigate } from 'react-router-dom';

const CrearUnirseSala = () => {
    const navigate = useNavigate();

    const crearSala = () => {
        navigate('/room-create'); // Redirige a la pantalla de creación de sala
    };

    const unirseSala = () => {
        navigate('/chat'); // Redirige a la sala de chat
    };

    return (
        <div>
            <h1>Selecciona o crea una sala</h1>
            <button onClick={crearSala}>Crear Sala</button>
            <button onClick={unirseSala}>Unirme a una Sala</button>
        </div>
    );
};

export default CrearUnirseSala;
